##E calc
##Calculates Euler's number
##Using a sum, source: https://www.youtube.com/watch?v=AuA2EAgAegE

actual = "2."
counter = 0
def checkE(value):
    global actual
    global counter
    for character in value:
        if character != actual[counter]:
            print("Mismatch found at "+str(counter+1))
            ##return counter
            break
        counter = counter + 1
    print("Accurate to "+str(counter)+" digits")
